"text": "<div>\n<i class=\"NoteType\">\nTapahtuman lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nT\u00e4m\u00e4 voi olla 1752 syntyneen Jacob Jacobssonin kastetapahtuma:<br />\nInkoon seurakunnan arkisto - Syntyneiden ja kastettujen luettelot 1736-1756, jakso 111, toukokuu 1752; Kansallisarkisto: https://astia.narc.fi/uusiastia/viewer/?fileId=5863059141&amp;aineistoId=1155567680 / Viitattu 27.5.2020<br />\nJacob<br />\n\u00d6stersolberg Lillungs Bondens? Jacob Johanssons och<br />\nHutro Chirstin Hansdrs barn f\u00f6ddas ~?.7. d\u00f6ptas ~?.co....?<br />\n[Kummit] \u00d6stersolberg Bl\u00e5ns Lars Carsson eller Ersson eller Larsson?, ho Margetha Matsdr<br />\noch Carin Carsdr eller Ersdr eller Larsdr?, Flyt eller F\u00e5gd? Henric Johansson, Hans? Bl\u00f6ln? Michel?<br />\nPeter Matsson, Lillungs Carin Johansdr\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
